(()=>{var l=document.getElementById("spis-tel"),t=document.getElementById("wlasciwy-spis-tel");l.addEventListener("click",()=>{t.classList.contains("show")?(t.style.height=`${t.scrollHeight}px`,setTimeout(()=>{t.style.height="0",t.style.opacity="0"},10),t.classList.remove("show")):(t.style.height=`${t.scrollHeight}px`,t.style.opacity="1",setTimeout(()=>{t.style.height="auto"},500),t.classList.add("show"))});var o=!1;if(!o){let s=document.querySelectorAll(".stat");s.length===4&&fetch("../stats.json").then(e=>e.json()).then(e=>{s[0].textContent=e.total_users,s[1].textContent=e.exercises,s[2].textContent=e.views,s[3].textContent=e.code_lines}).catch(e=>console.error(e))}})();
